

ALTER TABLE dqa_batch_report ADD vacc_vis_count INTEGER DEFAULT 0 NOT NULL;
ALTER TABLE dqa_batch_report ADD obs_count INTEGER DEFAULT 0 NOT NULL;


CREATE SEQUENCE dqa_known_name_id_sequence INCREMENT BY 1 START WITH 1;

CREATE TABLE dqa_known_name
(
  known_name_id       INTEGER NOT NULL PRIMARY KEY,
  name_last           VARCHAR(100),            
  name_first          VARCHAR(100),
  name_middle         VARCHAR(100),
  birth_date          DATE,
  name_type           VARCHAR(30) NOT NULL
);



ALTER TABLE dqa_vaccination_vis ADD cvx_code  VARCHAR(30);


CREATE SEQUENCE dqa_phone_id_sequence INCREMENT BY 1 START WITH 1;

CREATE TABLE dqa_patient_phone (
  phone_id       INTEGER NOT NULL PRIMARY KEY,
  patient_id     INTEGER NOT NULL,
  position_id    INTEGER NOT NULL,
  skipped        VARCHAR(1),
  phone_number   VARCHAR(100),
  tel_use_code   VARCHAR(30),
  tel_equip_code VARCHAR(30),
  email_address  VARCHAR(199),
  country_code   VARCHAR(30),
  area_code      VARCHAR(30),
  local_number   VARCHAR(30),
  extension      VARCHAR(30)
);


CREATE SEQUENCE dqa_id_number_id_sequence INCREMENT BY 1 START WITH 1;

CREATE TABLE dqa_patient_id_number (
  id_number_id  INTEGER NOT NULL PRIMARY KEY, 
  patient_id    INTEGER NOT NULL,
  position_id    INTEGER NOT NULL,
  skipped       VARCHAR(1),
  id_number     VARCHAR(30),
  assign_auth   VARCHAR(277),
  type_code     VARCHAR(30)
);


CREATE SEQUENCE dqa_address_id_sequence INCREMENT BY 1 START WITH 1;

CREATE TABLE dqa_patient_address (
  address_id            INTEGER NOT NULL PRIMARY KEY, 
  patient_id            INTEGER NOT NULL,
  position_id           INTEGER NOT NULL,
  skipped               VARCHAR(1),
  address_city          VARCHAR(100),
  address_country       VARCHAR(30),
  address_county_parish VARCHAR(30),
  address_state         VARCHAR(100),
  address_street        VARCHAR(120),
  address_street2       VARCHAR(120),
  address_type          VARCHAR(30),
  address_zip           VARCHAR(30)
);


CREATE SEQUENCE dqa_immunity_id_sequence INCREMENT BY 1 START WITH 1;

CREATE TABLE dqa_patient_immunity (
  immunity_id           INTEGER NOT NULL PRIMARY KEY, 
  patient_id            INTEGER NOT NULL,
  skipped               VARCHAR(1),
  immunity_code         VARCHAR(30)
);


